import React, { useState } from "react"




export const JobList = ({ jobs, data }) => {
  if(jobs.length){
    return jobs.map((job) => {
        return (
          <ul>
            <li>
              <p>{job.neighborhood}</p>
            </li>
            <li>
              <p>{job.picture}</p>
            </li>
            <li>
              <p>{job.worker}</p>
            </li>
            <div>
              <p>{job.date}</p>
            </div>
          </ul>
        )
    })  
    }else{
      return(
        <div>
          <h4>No Jobs Listed</h4>
        </div>
      )
    }

}


export default JobList
